ga1O(){return"Welcome to the Rules Section! Here, you'll quickly learn what you need to get started and have some fun!\n\n"},
ga1S(){return"How to play"},
ga1T(){return"To begin playing, simply press the 'Start Game' button and select the game mode (in this first version, only Singleplayer mode is available). Next, you can choose the role you want to play:\n\n"},
ga1U(){return"Once you've chosen your game mode, you can configure your game. You'll need to provide a brief description of the story's setting that you want to follow (including the condition to end the game) and create your character sheet. Don't worry if you have no experience with this; the game can generate a character sheet for you\u2014it does it all! (Currently, the game only provides auto-generated character sheets.)\n\n"},
ga1V(){return"After this, if you have enough tokens to play, you can start your new campaign!\n\n"},
ga1W(){return"This part is important. Since it's an AI that's responsible for guiding the game, and not a human, all players must commit to following certain guidelines to facilitate the flow of the game:\n\n"},
ga1X(){return"Adhere to your character sheet: Remember your character's details and incorporate them into the conversation whenever possible to provide more context to the AI. Don't change your character's details unless instructed to do so.\n\n"},
ga1Y(){return"Don't make up dice rolls: The natural mechanism for role-playing is dice rolls. If you're asked to make a roll, don't make up the values. Embrace the randomness!\n\n"},
ga1Z(){return"Keep the AI in context: We trust you to follow the story provided by the AI. After all, it's not human. Correct when necessary, make decisions your character would make, and forge your own path, but don't diverge into unrelated topics. You might confuse the AI and disrupt the narrative.\n\n"},
ga1P(){return"No cheating: We appeal to the goodwill of our players. If things go awry, don't hesitate to help the AI remember certain decisions and aspects of your character sheet.\n\n"},
ga1Q(){return"Behave as you would with your trusted Game Master: It's each player's responsibility to ensure it's an enjoyable and easy-to-follow game.\n\n"},
ga1R(){return"Disclaimer: Since it's an external conversational AI, we're not responsible for the content of the conversations. We trust in you!"},
